column8:
ミネラルたっぷりの”わかめ”に塩味と甘味を加え、さっぱりとした味付けのわかめご飯です。添付の白ごまが香ばしさのポイントです。<br><br>
添付品:ごま<br>
内容量/ 出来上がり量:5.0kg / 13.0kg<br>
ＪＡＮコード:4970088140188<br>
-------------------<br>
◇◆セット内容◆◇<br>
1.アルファ米2.具材3.割ばし4.輪ゴム5.しゃもじ6.衛生手袋7.弁当容器8.針金入りビニール紐9.開封用カッター10.説明書<br>
-------------------<br>
●短時間<br>
15分で、50人分のご飯が一度にできあがります。
注水線までお湯を注ぎ、待つこと15分(赤飯は20分)で50人分のご飯ができあがります。
(非常時は15℃の水で60分)<br>-------------------<br>
必要なお湯または水の量は、1セットにつき8リットル（100g当り160cc）となります。<br>-------------------<br>
●効率設計<br>
少人数でスピーディーな配食ができます。
非常時に、最小の人員で最大の配食能力を発揮する製品設計です。<br>-------------------<br>
●省スペース<br>
備蓄にオススメ<br>
1畳サイズで、10,000食以上の備蓄が可能。
1.8m×0.9m（1畳分）のスペースに12段組で、10,000食以上の備蓄が可能です。<br>-------------------<br>
●低コスト<br>
1食あたり220円からの備蓄が可能
1食あたり220円～300円と低コストでの備蓄が可能です。(当社希望小売価格換算)<br>-------------------<br>
●環境問題<br>
パッケージ素材は可燃性のものを多く使用。
配食完了後の塵芥量も最小限に抑えました。
(可燃性素材の採用により、缶詰等に比べ、格段にその量が低減されます)<br>-------------------<br>
●8つの味<br>
いろいろな味が楽しめます<br>
五目ごはん / 白飯 / わかめごはん / 赤飯 / 山菜おこわ / ドライカレー / チキンライス / えびピラフ<br><br><img src="http://image.rakuten.co.jp/be-kan/cabinet/tel.jpg"><style type="text/css">
