非常食は特別な物ではなく、普通においしく食べられる食事です。<br>
<br>
■火も水も使わずに、温かい本格的なカレーがお召し上がりいただけます！<br>
■ごはんの容器がトレーパックなので、カレーをかけてそのままお召し上がりいただけます。<br>
■常温で3年6ヶ月保存できます。！<br>
