------------<br>
内容量：200g <br>
原材料名：うるち米、pH調整剤<br>
------------<br>
<br>
◎ビーフカレー<br>
------------<br>
内容量：180g <br>
原材料：名野菜（たまねぎ、にんじん）、カレールー、牛肉、食物繊維（難消化性デキストリン）、エキス調味料、コーン油、たん白加水分解物、にんにく、カラメル色素、調味料（アミノ酸等）、（原材料の一部に乳成分、小麦、豚肉、大豆、りんご、バナナを含む）<br> 
------------<br>
<br>
